Let me think through this step by step...

The key psychological mechanisms involved in responder behavior in this ultimatum game are self-interest and a sense of fairness.  Responders will likely accept offers that provide a sufficient amount of money for themselves, but also consider the fairness of the offer relative to the contributions of each player.  A completely unfair offer, even if advantageous to the responder, might be rejected.

These mechanisms interact such that a responder will weigh their self-interest against their perception of fairness.  A high self-interest weight will lead to acceptance of even slightly unfair offers, while a high fairness weight will lead to rejection of unfair offers, even if they offer a significant monetary gain.

A mathematical form to capture this interaction could be a linear combination of self-interest and fairness, where each component is weighted by a learnable parameter reflecting the individual's relative importance placed on each.  The fairness term needs to incorporate the ratio of token contributions to normalize the split percentages and avoid confounding effects of different total earnings.

We can capture this with two learnable parameters representing the individual's relative weighting of self-interest and fairness. We will use a simple ratio of the proposed split to the relative contribution to assess fairness.

The model variables map to observable behavior as follows:  higher self-interest weight leads to more acceptance of offers that provide a larger share for the participant.  Higher fairness weight leads to a greater tendency to reject offers that appear unfair given the ratio of token contributions.

